import Axios from "axios"

export default function Login(email, password) {

    Axios( {
        method: "post",
        url: "http://www.paste.services/login/check",
        headers: {
            'Content-Type': 'application/json; charset=UTF-8'
        },
        data: {
            "email": email,
            "password": password,
        },
    } ).then( ( res ) => {

        // Successfully logged in
        if ( res.data === "1" ) {

            const cookieRes = CreateCookie( email, 7 )

            cookieRes['success'] === "1" &&
                JsCookie.set( "rememberMe", escape())
        }
        console.log( "Response: " + res.data )
    } )
}
